    function typeNextCharacter() {
        if (messageIndex < loadingMessages.length) {
            if (charIndex < loadingMessages[messageIndex].length) {
                loadingTextElement.textContent += loadingMessages[messageIndex][charIndex];
                charIndex++;
                setTimeout(typeNextCharacter, 1); // Adjust typing speed here
            } else {
                charIndex = 0;
                messageIndex++;
                loadingTextElement.textContent += "\n";
                setTimeout(typeNextCharacter, 1); // Delay before the next message
            }
        } else {
            document.querySelector('.loading-screen').style.display = 'none';
        }
    }

